import React from 'react';

const About = () => {
    return (
        <div className="about">
            <h2>About Me</h2>
            <p>I am [Your Name], a developer with expertise in React, JavaScript, and front-end development. I have worked on multiple projects and received recognition for my work, such as being in the top 3 at my college.</p>
        </div>
    );
};

export default About;
